INSERT INTO `v1_342e961212ca8fe534a92b234427a3c7aeed50bb38b460e7f6169e351d88d15a` VALUES (1905, "ダメージ減衰", 92425340, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18);
INSERT INTO `v1_342e961212ca8fe534a92b234427a3c7aeed50bb38b460e7f6169e351d88d15a` VALUES (1906, "ＴＰ上昇上限付与", 92425340, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 17);
INSERT INTO `v1_342e961212ca8fe534a92b234427a3c7aeed50bb38b460e7f6169e351d88d15a` VALUES (1907, "ＨＰ吸収ダウン", 92425340, "バトル開始時、すべてのキャラのＨＰ吸収を中ダウンさせる。", 9);
INSERT INTO `v1_342e961212ca8fe534a92b234427a3c7aeed50bb38b460e7f6169e351d88d15a` VALUES (1908, "ダメージカット", 92425340, "バトル開始時、すべてのモンスターがダメージ\n30％カット状態になる。", "boss_damage_cut");
